import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import CardData from './CardInfo';

//console.log(CardData[1]);

function nCard(value){
  return (
    <>
      src={value.mySrc}
      link={value.mySrc}
      category={value.mySrc}
      title={value.mySrc}
    </>
  )
}

ReactDOM.render(
  <>
    <Card
      src={CardData[0].mySrc}
      link={CardData[0].myLink}
      category={CardData[0].myCategory}
      title={CardData[0].myTitle}
    />


    <Card
       src={CardData[1].mySrc}
       link={CardData[1].myLink}
       category={CardData[1].myCategory}
       title={CardData[1].myTitle}
    />

    <Card

      newCarData = {CardData.map(nCard)}

    />

  </>,document.getElementById('root')
);
